import MSFTParagraph, { ParagraphSize, } from "./paragraph";
import paragraphSchema from "./paragraph.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { ParagraphStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Paragraph = manageJss(ParagraphStyles)(MSFTParagraph);
export { Paragraph, ParagraphSize, paragraphSchema, };
